import React from 'react';
import list from '../data';
import '../styles/amazon.css';
import Cards from './Cards';

const Amazon = ({ handleClick, list, setList }) => {
  return (
    <section>
      {list.map((item) => (
        <Cards
          item={item}
          key={item.id}
          handleClick={handleClick}
          setList={setList}
        />
      ))}
    </section>
  );
};


export default Amazon;
